import React from 'react'

function Social() {
  return (
    <div className="home_social">
        <a href="https://www.linkedin.com/in/nejc-kova%C4%8D-82542b254/" className="home_social-icon" target="_blank"> <i class="fa-brands fa-linkedin"></i></a>
        <a href="" className="home_social-icon" target="_blank"> <i class="fa-brands fa-github"></i></a>
    </div>
  )
}

export default Social
